Immutables autogenerated for MongoDB throws "Can't find a codec for class Immutable.."<p><strong>Problem Description.</strong></p>
<p>So I have an item that I want to use with MongoDB</p>
<pre><code>@Value.Immutable
@Gson.TypeAdapters
@Criteria.Repository
interface Person {
    @Criteria.Id
    String id();

    String fullName();
}
</code></pre>
<p>And in-order to support pojos, I've created a MongoClient with the following settings:</p>
<pre><code>CodecRegistry pojoCodecRegistry = fromProviders(PojoCodecProvider.builder().automatic(true).build());
        CodecRegistry codecRegistry = fromRegistries(MongoClientSettings.getDefaultCodecRegistry(), pojoCodecRegistry);

        MongoClientSettings clientSettings = MongoClientSettings.builder()
                .applyConnectionString(connectionString)
                .codecRegistry(codecRegistry)
                .build();
</code></pre>
<p>However, whenever I try to perform an insert operation, I receive an error whereas bson can't find the codec for the Immutable class.</p>
<p>The code that creates the problem:</p>
<pre><code>        MongoCollection&lt;Person&gt; people = db.getCollection(&quot;peoples&quot;, Person.class).withCodecRegistry(pojoCodecRegistry);
        Person person = ImmutablePerson.builder()
                .id(&quot;1&quot;)
                .fullName(&quot;person&quot;)
                .build();

        InsertOneResult result = people.insertOne(shahar);
</code></pre>
<p>And the error:</p>
<blockquote>
<p>Exception in thread &quot;main&quot; org.bson.codecs.configuration.CodecConfigurationException: Can't find a codec for class with.immutables.ImmutablePerson.</p>
</blockquote>
<p>I've tried registering a ClassModel to CodecRegistry for ImmutablePerson as shown below</p>
<pre><code>     .register(ClassModel.builder(ImmutablePerson.class).enableDiscriminator(true).build())
</code></pre>
<p>However, it saves the &quot;instance&quot; instead of the data in it</p>
<p><a href="https://i.stack.imgur.com/0GeyB.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/0GeyB.png" alt="enter image description here" /></a></p>
<p><strong>Question</strong></p>
<p>What needs to be changed so that the simple insert operation works?
Is it possible to do it with immutables?</p>

