embedfield:
How res.redirect() is different than res.render() after saving a data entry in mongoose despite both are having same code?<p>I have a HTML form where data is submitted to mongoDB using express and mongoose. After submitting data to mongoDB, client is shown up with the table containing all the records
which is be done by redirecting to new page where all the records are shown.</p>
<p><em>Both ways are similar but later doesn’t show last (current) entry.</em></p>
<p>Way 1 (works perfectly fine):</p>
<pre><code>app.post(&quot;/&quot;, (res, req) =&gt; {
const item = new Item(req.body);
item.save();
res.redirect(&quot;/results&quot;); 
});

app.get(&quot;/results&quot;, (res, req) =&gt; {
Item.find({}, (err, foundResult) =&gt; {
res.render(&quot;table.html&quot;, {data:foundResult});
});
});
</code></pre>
<p>Way 2 (doesn’t show latest entry):</p>
<pre><code>app.post(&quot;/&quot;, (res, req) =&gt; {
const item = new Item(req.body);
item.save();

Item.find({}, (err, foundResult) =&gt; {
res.render(&quot;table.html&quot;, {data:foundResult});
});
});
</code></pre>
<p>Way 2 shows all the data from database except the current entry.</p>
<p><strong>How the code behaves normal when passed through res.redirect() and abnormal when ditto same code is executed without res.redirect()?</strong></p>

