API request getting stuck in POSTMAN?<p>So, I am making an e-shop app which uses Mongo DB and Express JS as the backend. I have already created the productSchema, userSchema and the categorySchema and have coded for the appropriate GET requests.</p>
<p>I have made a jwt.js file which handles whether the the GET request should be allowed or not based on the token.</p>
<p>The code for jwt.js is given below</p>
<pre><code>const { expressjwt } = require(&quot;express-jwt&quot;);

function authJwt() {
  const secret = process.env.secret;
  const api = process.env.API_URL;
  return expressjwt({
    secret,
    algorithms: [&quot;HS256&quot;],
    isRevoked: isRevoked,
  }).unless({
    path: [
      { url: /\/api\/v1\/products(.*)/, methods: [&quot;GET&quot;, &quot;OPTIONS&quot;] },
      { url: /\/api\/v1\/categories(.*)/, methods: [&quot;GET&quot;, &quot;OPTIONS&quot;] },
      `${api}/users/login`,
      `${api}/users/register`,
    ],
  });
}

async function isRevoked(req, payload, done) {
  if (!payload.isAdmin) {
    done(null, true);
  }

  done();
}

module.exports = authJwt;
</code></pre>
<p>The code for products.js which handles the GET, POST, PUT and DELETE requests for the products database is given below.</p>
<pre><code>const { Product } = require(&quot;../models/product&quot;);
const express = require(&quot;express&quot;);
const { Category } = require(&quot;../models/category&quot;);
const router = express.Router();
const mongoose = require(&quot;mongoose&quot;);

router.get(`/`, async (req, res) =&gt; {
  // localhost:3000/api/v1/products?categories=2342342,234234
  let filter = {};
  if (req.query.categories) {
    filter = { category: req.query.categories.split(&quot;,&quot;) };
  }

  const productList = await Product.find(filter).populate(&quot;category&quot;);

  if (!productList) {
    res.status(500).json({ success: false });
  }
  res.send(productList);
});

router.get(`/:id`, async (req, res) =&gt; {
  const product = await Product.findById(req.params.id).populate(&quot;category&quot;);

  if (!product) {
    res.status(500).json({ success: false });
  }
  res.send(product);
});

router.post(`/`, async (req, res) =&gt; {
  const category = await Category.findById(req.body.category);
  if (!category) return res.status(400).send(&quot;Invalid Category&quot;);

  let product = new Product({
    name: req.body.name,
    description: req.body.description,
    richDescription: req.body.richDescription,
    image: req.body.image,
    brand: req.body.brand,
    price: req.body.price,
    category: req.body.category,
    countInStock: req.body.countInStock,
    rating: req.body.rating,
    numReviews: req.body.numReviews,
    isFeatured: req.body.isFeatured,
  });

  product = await product.save();

  if (!product) return res.status(500).send(&quot;The product cannot be created&quot;);

  res.send(product);
});

router.put(&quot;/:id&quot;, async (req, res) =&gt; {
  if (!mongoose.isValidObjectId(req.params.id)) {
    return res.status(400).send(&quot;Invalid Product Id&quot;);
  }
  const category = await Category.findById(req.body.category);
  if (!category) return res.status(400).send(&quot;Invalid Category&quot;);

  const product = await Product.findByIdAndUpdate(
    req.params.id,
    {
      name: req.body.name,
      description: req.body.description,
      richDescription: req.body.richDescription,
      image: req.body.image,
      brand: req.body.brand,
      price: req.body.price,
      category: req.body.category,
      countInStock: req.body.countInStock,
      rating: req.body.rating,
      numReviews: req.body.numReviews,
      isFeatured: req.body.isFeatured,
    },
    { new: true }
  );

  if (!product) return res.status(500).send(&quot;the product cannot be updated!&quot;);

  res.send(product);
});

router.delete(&quot;/:id&quot;, (req, res) =&gt; {
  Product.findByIdAndRemove(req.params.id)
    .then((product) =&gt; {
      if (product) {
        return res
          .status(200)
          .json({ success: true, message: &quot;the product is deleted!&quot; });
      } else {
        return res
          .status(404)
          .json({ success: false, message: &quot;product not found!&quot; });
      }
    })
    .catch((err) =&gt; {
      return res.status(500).json({ success: false, error: err });
    });
});

router.get(`/get/count`, async (req, res) =&gt; {
  const productCount = await Product.countDocuments((count) =&gt; count);

  if (!productCount) {
    res.status(500).json({ success: false });
  }
  res.send({
    productCount: productCount,
  });
});

router.get(`/get/featured/:count`, async (req, res) =&gt; {
  const count = req.params.count ? req.params.count : 0;
  const products = await Product.find({ isFeatured: true }).limit(+count);

  if (!products) {
    res.status(500).json({ success: false });
  }
  res.send(products);
});

module.exports = router;
</code></pre>
<p>Now, the codes for the users.js and categories.js are similar and thus I am not sharing it.</p>
<p>I am getting the problem when doing GET request for products using POSTMAN API. Even though I am passing the correct token using BEARER TOKEN field in the POSTMAN API, it is getting stuck at sending request. When I delete the isRevoked part, everything works fine, but then again I can't control the get request based on the isAdmin part. So, the problem is in the isRevoked part. But, what exactly is the issue. It seems fine to me logically.</p>

